script: |
  super -f text -I q985.spq | sort > q985.out

inputs:
  - name: q985.spq
    data: |
      SELECT DISTINCT + 17, + col1 * - col1 + col2 AS col0 FROM tab0 (FORMAT parquet) WHERE - col0 <> - col0 * + col1 * - - 9;
  - name: tab0

outputs:
  - name: q985.out
    data: |
      17	-431
      17	-6514
      17	98
